    //             <div className={contStyle.contactInfo}><strong>phone:</strong> {phone}</div>
    //         </div>
    //     </div>
    // )

    return (
        <div>
            <img src="/svg/bellB.svg" alt="bell" />
            <div className="navbar-height" />
            <div className={contStyle.contactsContainer}>
            <div className={contStyle.contactContainer}>
                <div href="/user/SebastianSosa" className={`${contStyle.contactHeader} neutralize-link`}>
                    <img src='/svg/logo/logoW.svg' className={contStyle.CHIcon} alt="ProjectU" />
                    <h3 className={contStyle.CHName}>Sebastian Sosa</h3>
                </div>
                <img src="https://i.imgur.com/zgwIwOS.png" className={contStyle.profileImage} alt="profile" />
                <div className={contStyle.contactInfoContainer}>
                    <div className={contStyle.contactInfo} style={{backgroundColor: '#f6f6f9'}}><strong>position:</strong>founder, full stack developer</div>
                    <div className={contStyle.contactInfo}><strong>email:</strong>1sebastian1sosa1@gmail.com</div>
                    <div className={contStyle.contactInfo}><strong>phone:</strong>+1 786-270-7297</div>
                </div>
            </div>
                {/* <Contributer
                    name="Sebastian Sosa"
                    link="/user/SebastianSosa"
                    image="https://i.imgur.com/zgwIwOS.png"
                    position="founder, full stack developer"
                    email="1sebastian1sosa1@gmail.com"
                    phone="+1 786-270-7297"
                />
                <Contributer
                    name="Umyarov Mikhail"
                    link="/user/nesutortik"
                    image="https://i.imgur.com/ew81eQe.png"
                    position="UI/UX designer"
                    email="silverusdragonitos@yandex.ru"
                    phone="+7 952-156-96-49"
                /> */}
            </div>
        </div>
    )
}

